import React from "react"
import { Navigation } from "swiper";
import { Swiper } from "swiper/react";

import 'swiper/scss';
import 'swiper/scss/navigation';

import PickCarouselItem from "./PickCarouselItem";

const PickCarousel = () => {
  const imgWidth = [
    "200x",
    "300x",
    "400x",
    "600x",
    "800x",
  ];

  return (
    <Swiper
      spaceBetween={20}
      slidesPerView={4}
      slidesPerGroup={4}
      modules={[Navigation]}
      grabCursor={true}
      navigation
    >
      <PickCarouselItem />
    </Swiper>
  )
}

export default PickCarousel
